attributes: []
deprecated: false
doc: '

  Outputs a tensor sequence that inserts ''tensor'' into ''input_sequence'' at ''position''.

  ''tensor'' must have the same data type as ''input_sequence''.

  Accepted range for ''position'' is in `[-n, n]`, where `n` is the number of tensors
  in ''input_sequence''.

  Negative value means counting positions from the back.

  ''position'' is optional, by default it inserts ''tensor'' to the back of ''input_sequence''.

  '
domain: ''
inputs:
- description: Input sequence.
  min_arity: 1
  name: input_sequence
  tags: []
  type_str: S
- description: Input tensor to be inserted into the input sequence.
  min_arity: 1
  name: tensor
  tags: []
  type_str: T
- description: Position in the sequence where the new tensor is inserted. It is optional
    and default is to insert to the back of the sequence. Negative value means counting
    positions from the back. Accepted range in `[-n, n]`, where `n` is the number
    of tensors in 'input_sequence'. It is an error if any of the index values are
    out of bounds. It must be a scalar(tensor of empty shape).
  min_arity: 1
  name: position
  tags:
  - optional
  type_str: I
max_input: 3
max_output: 1
min_input: 2
min_output: 1
name: SequenceInsert
outputs:
- description: Output sequence that contains the inserted tensor at given position.
  min_arity: 1
  name: output_sequence
  tags: []
  type_str: S
since_version: 11
support_level: SupportType.COMMON
